import React, { useEffect } from 'react';
import AuthUser from './AuthUser';

export default function Dashboard() {
  const { wpisy, fetchPosts } = AuthUser();

  useEffect(() => {
    fetchPosts();
  }, []);

  return (
    <div>
      <h1>Dashboard</h1>
      <table>
        <thead>
          <tr>
            <th>ID</th>
            <th>User</th>
            <th>Tresc</th>
          </tr>
        </thead>
        <tbody>
          {wpisy.map((wpis) => (
            <tr key={wpis.id}>
              <td>{wpis.id}</td>
              <td>{wpis.user.name}</td>
              <td>{wpis.tresc}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}
